import React, { useState } from "react";

export default function Button() {
  const [cls, setCls] = useState("green");

  return (
    <>
      <style>{`
        .red {background-color: red}
        .green {background-color: green}
      `}</style>
      <button
        className={cls}
        onClick={() => setCls((cls) => (cls === "red" ? "green" : "red"))}
      >
        Button
      </button>
    </>
  );
}
